import { Paper, Typography, makeStyles, IconButton } from "@material-ui/core";
import CheckBox from "@material-ui/core/Checkbox";
import React from 'react'
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';
const useStyle = makeStyles({
    root:{
        width:'100%',
        margin:'5px 0',
        display:'flex',
        justifyContent:'start',
        alignItems:'center',
        cursor:'pointer',
        transition:'.3s ease',
        '&:hover':{
            background:'rgba(253, 114, 114,0.2)'
        }
    }
})
export default function ListTodo(asset){
    const classes = useStyle();
    const [checked,setChecked] = React.useState(false)
    return(
        <Paper spacing={2} className={classes.root}>
            <CheckBox
                checked={checked}
                onChange={()=> setChecked(pre => !pre)} 
            />
            <Typography style={{width:'80%'}} align='left'  children={asset.asset.todo} />
            <IconButton>
                <DeleteOutlineIcon/>
            </IconButton>
        </Paper>
    )
}
